css:
.github-StubItem-git,
.github-Git-root {
  flex: 1;
  display: flex;
}
.github-Git {
  flex: 1;
  display: flex;
  flex-direction: column;
  min-width: 0;
  font-family: ".SFNSText", "Lucida Grande", "Segoe UI", sans-serif;
  font-size: 12px;
  color: #424242;
  -webkit-user-select: none;
  cursor: default;
}
.github-Git.no-repository {
  padding: 36px;
  text-align: center;
}
.github-Git.is-loading {
  color: #999999;
}
.github-Git.no-repository {
  display: flex;
  justify-content: center;
  font-size: 1.25em;
}
.github-Git.no-repository > * {
  margin: 12px 0;
}
.github-Git.no-repository .git-logo-path {
  fill: #b1b1b1;
}
.github-Git.no-repository .btn.btn-primary {
  overflow: hidden;
  text-overflow: ellipsis;
}
